window.bookSummaryJSON = "<p>In his soft yet captivating voice, award-winning actor Tony Shalhoub (<i>Marvelous Mrs. Maisel</i>, <i>Monk</i>) calmly tells the tale of how the ancient Greeks formalized the study of mathematics based on Phoenician teachings. </p> <p>Bedtime stories are narrated by the world’s most celebrated voices and written with no beginning, middle, or end so you don’t stay up to hear what happens next. They're interesting enough to give your mind something to focus on, but delivered in a way that encourages sleep. </p> <p>This title is part of the Audible Sleep Collection, exclusive audio experiences created to invite relaxation and sleep. New and free for members.</p>"; 
